import { useEffect, useState } from "react";
import api from "../utils/api";
import "./myscores.css";

export default function MyScores() {
  const [scores, setScores] = useState([]);
  const [selectedScore, setSelectedScore] = useState(null);

  useEffect(() => {
    const fetchScores = async () => {
      try {
        const { data } = await api.get("/student/scores");
        setScores(data.scores || []);
      } catch (err) {
        console.error("Error fetching scores:", err.response || err);
      }
    };
    fetchScores();
  }, []);

  const getColor = (percent) => {
    if (percent < 35) return "#f87171"; // fail
    if (percent <= 80) return "#facc15"; // good
    return "#34d399"; // excellent
  };

  const formatDate = (timestamp) => {
    if (!timestamp) return "N/A";
    try {
      const date = new Date(timestamp);
      return date.toLocaleString(); // formatted date and time
    } catch {
      return timestamp;
    }
  };

  // Group scores by category safely
  const groupedScores = scores.reduce((acc, score) => {
    const category = score.category || "unknown"; // fallback if undefined
    if (!acc[category]) acc[category] = [];
    acc[category].push(score);
    return acc;
  }, {});

  return (
    <div className="myscores-container">
      <h1>My Scores</h1>

      {Object.keys(groupedScores).length === 0 && <p>No scores available yet.</p>}

      {Object.keys(groupedScores).map((category) => (
        <div key={category} className="category-section">
          <h2 className="category-title">{category.toUpperCase()}</h2>
          <div className="scores-grid">
            {groupedScores[category].map((score) => {
              const obtained = score.obtainedMarks ?? 0;
              const total = score.totalMarks ?? 0;
              const percent = total > 0 ? (obtained / total) * 100 : 0;

              return (
                <div
                  key={score._id}
                  className="score-card"
                  style={{
                    borderTop: `4px solid ${getColor(percent)}`,
                  }}
                >
                  <h3 className="test-name">{score.testName || "Unnamed Test"}</h3>
                  <p className="timestamp">{formatDate(score.submittedAt)}</p>
                  <p>
                    Score:{" "}
                    <span style={{ color: getColor(percent) }}>
                      {obtained}/{total} ({percent.toFixed(2)}%)
                    </span>
                  </p>
                  <button
                    className="view-btn"
                    onClick={() => setSelectedScore({ ...score, percent })}
                  >
                    View Details
                  </button>
                </div>
              );
            })}
          </div>
        </div>
      ))}

      {/* Modal */}
      {selectedScore && (
        <div className="modal-overlay" onClick={() => setSelectedScore(null)}>
          <div className="modal" onClick={(e) => e.stopPropagation()}>
            <button className="close-btn" onClick={() => setSelectedScore(null)}>
              âœ•
            </button>
            <h2>{selectedScore.testName || "Unnamed Test"}</h2>
            <p>
              <strong>Category:</strong>{" "}
              {(selectedScore.category || "Unknown").toUpperCase()}
            </p>
            <p>
              <strong>Score:</strong>{" "}
              <span style={{ color: getColor(selectedScore.percent) }}>
                {selectedScore.obtainedMarks ?? 0}/{selectedScore.totalMarks ?? 0} (
                {selectedScore.percent.toFixed(2)}%)
              </span>
            </p>
            <p>
              <strong>Time Submitted:</strong> {formatDate(selectedScore.submittedAt)}
            </p>
            <p>
              <strong>Report:</strong>{" "}
              Your performance shows consistent understanding of basic concepts
              but needs improvement in complex questions. Try to revise and practice
              more scenario-based exercises.
            </p>
            <p>
              <strong>Improvement:</strong>{" "}
              {selectedScore.percent < 35
                ? "Focus on fundamentals and practice regularly."
                : selectedScore.percent <= 80
                ? "Good work! Revise tricky questions and optimize speed."
                : "Excellent! Keep practicing to maintain high accuracy."}
            </p>
          </div>
        </div>
      )}
    </div>
  );
}
